function GetUnicodeData(codepoint){
	if(UnicodeData[codepoint] && !UnicodeData[codepoint].Name.match(/, (?:first|last)>/i)){
		return UnicodeData[codepoint]
	}
	var cpnum = Number(codepoint);
	if(cpnum>=0x3400 && cpnum<=0x4DBF){//CJK Ideograph Extension A
		return {"Name": "CJK Unified Ideograph-"+cpnum.toString(16).toUpperCase().padStart(4,"0"), "Category": "Lo"};
	}
	if(cpnum>=0x4E00 && cpnum<=0x9FFF){//CJK Ideograph
		return {"Name": "CJK Unified Ideograph-"+cpnum.toString(16).toUpperCase().padStart(4,"0"), "Category": "Lo"};
	}
	if(cpnum>=0xAC00 && cpnum<=0xD7AF){//Hangul Syllable
		return {"Name": "Hangul Syllable-"+cpnum.toString(16).toUpperCase().padStart(4,"0"), "Category": "Lo"};
	}
	if(cpnum>=0xD800 && cpnum<=0xDB7F){//Non Private Use High Surrogate
		return {"Name": "Non Private Use High Surrogate-"+cpnum.toString(16).toUpperCase().padStart(4,"0"), "Category": "Cs"};
	}
	if(cpnum>=0xDB80 && cpnum<=0xDBFF){//Private Use High Surrogate
		return {"Name": "Private Use High Surrogate-"+cpnum.toString(16).toUpperCase().padStart(4,"0"), "Category": "Cs"};
	}
	if(cpnum>=0xDC00 && cpnum<=0xDFFF){//Low Surrogate
		return {"Name": "Low Surrogate-"+cpnum.toString(16).toUpperCase().padStart(4,"0"), "Category": "Cs"};
	}
	if(cpnum>=0xE000 && cpnum<=0xF8FF){//Low Surrogate
		return {"Name": "Private Use-"+cpnum.toString(16).toUpperCase().padStart(4,"0"), "Category": "Co"};
	}
}
function GetUnicodeBlock(c){
	return UnicodeBlocks.find(a=>a[0][0]<=c&&a[0][1]>=c)?.[1];
}

<script>
function doProcessing(action){
	document.body.classList.toggle("busy", true);
	var startTime = performance.now();
	requestAnimationFrame(() => {
	requestAnimationFrame(() => {
		action();
		requestAnimationFrame(() => {
		requestAnimationFrame(() => {
			document.body.classList.toggle("busy", false);
			var endTime = performance.now();
			console.log("Since load: " + endTime);
			console.log("Processing time: " + (endTime - startTime));
			
		});
		});
	});
	});
}
window.addEventListener("DOMContentLoaded", function(){
	var toc = document.getElementById("toc");
	var gotoTopTemplate = document.getElementById("gotoTop");
	
	var cdat = document.getElementById("chardataraw");
	window.cdat= cdat;
	var cdatInBlocks = ({});
	let inUnknownBlock = false;
	let unknownBlockId = 0;
	let blockOrder = [];
	[...cdat.querySelectorAll("ch")].forEach(ch=>{
		let c = ch.getAttribute("c");
		let h = ch.getAttribute("h");
		let n = "U+"+Number(c).toString(16).toUpperCase().padStart(4,"0");
		let u = GetUnicodeData(c);
		let b = GetUnicodeBlock(c);
		if(!b){
			if(!inUnknownBlock){
				++unknownBlockId;
				inUnknownBlock = true;
			}
			b = "UnknownBlock"+unknownBlockId;
		}else{
			inUnknownBlock = false;
		}
		if(blockOrder.at(-1)!=b){
			if(blockOrder.includes(b)){
				console.warn("Discontinuous block detected! "+b);
				debugger;
			}
			blockOrder.push(b);
		}
		cdatInBlocks[b] ??= [];
		let charboxHTML = `<charbox title="${b}\n${u?.Name}\n${c}\t${n}"><span>${h}</span></charbox>`;
		cdatInBlocks[b].push(charboxHTML);
	});
	cdat.innerHTML = "";
	blockOrder.map(a=>[a,cdatInBlocks[a].join("\n")]).forEach(bdat=>{
		let tocLabelLink = document.createElement("a");
		tocLabelLink.href = "#"+bdat[0];
		tocLabelLink.textContent = bdat[0];
		toc.appendChild(tocLabelLink);
		
		let contlabel = document.createElement("div");
		contlabel.className = "charboxcontainerlabel";
		{
			contlabel.appendChild(gotoTopTemplate.content.cloneNode(true));
			let contlabel_anchor = document.createElement("a");
			contlabel_anchor.href = "#"+bdat[0];
			contlabel_anchor.id = bdat[0];
			contlabel_anchor.textContent = bdat[0];
			contlabel.appendChild(contlabel_anchor);
		}
		cdat.appendChild(contlabel);
		
		let cont = document.createElement("div");
		cont.className = "charboxcontainer";
		cont.innerHTML += bdat[1];
		cdat.appendChild(cont);
	});
	cdat.id = "chardata";
	cdat.style.display = "";
});
window.addEventListener("DOMContentLoaded", function(){
	var charRenderFontSizeScaleElem = document.getElementById("charRenderFontSizeScale");
	charRenderFontSizeScaleElem.addEventListener("change", (event)=>{
		doProcessing(()=>{
			var newSize = Number(charRenderFontSizeScaleElem.value) + "%";
			document.body.style.setProperty("--charrenderfontsize", newSize);
			var valElem = charRenderFontSizeScaleElem.parentElement.querySelector("span.value");
			if(valElem){
				valElem.textContent = newSize;
			}
		});
	});
	charRenderFontSizeScaleElem.addEventListener("input", (event)=>{
		var newSize = Number(charRenderFontSizeScaleElem.value) + "%";
		var valElem = charRenderFontSizeScaleElem.parentElement.querySelector("span.value");
		if(valElem){
			valElem.textContent = newSize;
		}
	});
	charRenderFontSizeScaleElem.dispatchEvent(new Event("change"));
});
</script>

body {

}
body.busy, body.busy * {
	cursor: wait !important;
}
.charboxcontainerlabel {
	margin-block-start: 1rem;
	margin-block-end: 0.1rem;
	margin-inline: 0.3rem;
	font-weight: bolder;
	font-size: larger;
}
.charboxcontainer {
	margin-inline: 0.3rem;
	display: grid;
	grid-template-columns: repeat(16, 1fr);
	width: fit-content;
	font-size: var(--charrenderfontsize);
	
	& charbox {
		outline: 1px solid currentColor; 
		min-width: 1em;
		text-align: center;
	}
}
.sticky {
	position: sticky;
	top: 0;
	container-type: scroll-state;
	container-name: sticky-heading;
}
#viewOptions {
	margin: 0.5em;
	padding: 0.5em;
	transition: top 1s linear;
	width: fit-content;
	
	& input[type="range"] {
		vertical-align: middle;
	}
}
#toc {
	max-height: 70vh;
	overflow: auto; 
	width: fit-content;
	background-color: color-mix(in srgb, currentColor 2%, transparent 98%);
	border: 0.3rem ridge currentColor;
	padding: 0.3rem;
	margin: 0.3rem;
	
	& a {
		display: list-item;
		margin-inline-start: 2em;
		width: fit-content;
	}
}
.gotoTop {
	text-decoration: none;
	font-size: 80%;
	vertical-align: text-top;
	margin-inline-start: 0.5rem;
	margin-inline-end: 0.8rem;
}
@container sticky-heading scroll-state(stuck: top) {
	#viewOptions {
		background-color: red;
		top: 0.5em;
	}
}
